Insert into CY.ANALYZED_COMMENTS (COMMENTTEXT,PATTERN_POLARITY,PATTERN_SUBJECTIVITY,NAIVESBAYES_PROBABILITY_POSITIVE,NAIVESBAYES_PROBABILITY_NEGATIVE) values ('I am against subsidizing the electric Car industry.',0,0,0.715775073,0.284224927);
Insert into CY.ANALYZED_COMMENTS (COMMENTTEXT,PATTERN_POLARITY,PATTERN_SUBJECTIVITY,NAIVESBAYES_PROBABILITY_POSITIVE,NAIVESBAYES_PROBABILITY_NEGATIVE) values ('I thank you for the commitment to the environment you are showing with this proposal. I am greatly in favor and hope it passes. It''s needed even more now with current anti-environmental policies being put into play at the federal level.',0.433333333,0.55,0.630276149,0.369723851);
Insert into CY.ANALYZED_COMMENTS (COMMENTTEXT,PATTERN_POLARITY,PATTERN_SUBJECTIVITY,NAIVESBAYES_PROBABILITY_POSITIVE,NAIVESBAYES_PROBABILITY_NEGATIVE) values ('Thank you for (1) offering the full rebates allowed by law and (2) making all qualifying vehicles purchased after January 1, 2018 eligible for those rebates.',0.35,0.55,0.981374958,0.018625042);
Insert into CY.ANALYZED_COMMENTS (COMMENTTEXT,PATTERN_POLARITY,PATTERN_SUBJECTIVITY,NAIVESBAYES_PROBABILITY_POSITIVE,NAIVESBAYES_PROBABILITY_NEGATIVE) values ('As a life-long Oregonian, I appreciate our clean environment. Thanks for helping keep it that way and making it better.',0.355555556,0.466666667,0.8101236,0.1898764);
