Insert into CY.ANALYZED_COMMENTS (COMMENTTEXT,PATTERN_POLARITY,PATTERN_SUBJECTIVITY,NAIVESBAYES_PROBABILITY_POSITIVE,NAIVESBAYES_PROBABILITY_NEGATIVE) values ('Thank you for this opportunity to comment on the Proposed Rulemaking for Zero Emission and Electric Vehicle Rebate Program  These rules are too limited in scope because they designed to subsidize only large electric vehicles. We request that they be modified and that definitions of qualifying vehicles include small electric vehicles (SEVs).   There are many dozens of makes and models of SEVs on the market, including scooters. bicycles, tricycles, and velomobiles. Their sales are limited due to costs related, in part,  to the electric motor.  Providing a sizable rebate for SEVs would likely change that. This could benefit low-income residents, for whom purchase of large electric vehicles, even used vehicles, is prohibitively expensive.  There are obvious public health benefits to use of SEVs but encouraging use of these vehicles would produce additional economic benefit for SEV manufacturers in Oregon.  Examples of proposed definitions that exclude most SEVs:  1. The definition of "light-duty zero emission vehicle" includes only vehicles capable of traveling at 55 MPH.   2 The definition requires that the vehicle have four wheels.  3.The requirement that the vehicle be able to travel 75 miles on a charge.   4.The definition of "neighborhood electric vehicle" as one can at travel at 25 mph. This excludes electric-assist bicycles and tricycles and velomobiles, as Oregon law requires that they have a top speed of 24 mph.  5.The definition of "zero-emission motorcycle"  requires that the vehicle go 55 mph, a speed not desirable or even legal for most urban trips.   Additionally, the rules should be improved to support hybrid human-electric powered tricycles, which reduce diesel pollution from trucks and  increase energy efficiency in transporting freight. One need only look to Europe for examples of cities have banned combustion-engine trucks from their central areas. Electric vehicles, including fleets of hybrid human-electric powered tricycles, are used there to deliver goods.  SEV''s reduce air and noise pollution, reduce traffic congestion and improve public health. Please include SEV''s in the rebate program.  Thank you for your consideration,  Regna Merritt',0.100428571,0.453047619,0.999970521,0.0000295);
