Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Patrick','Gibson','tesla@pegibson.com',null,'Oregon','$50,000 max price should be set on base MSRP (excluding options). This artificial limit prevents people from transitioning to the best EV cars available. Over time, electric cars will come down in price, but the initial batches will be more expensive. The spirit of this law is to encourage people to invest in renewable resources. By adding limits in this way, it discourages people from getting the best product available, thus delaying the time that they transition to sustainable resources.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Kerry','Skemp','kerry.skemp@gmail.com','Self','OR','Incentives are proven to promote the adoption of EVs, which clear the air, spare the environment to the benefit of society. I support the rebate program.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Kevon','Lindenberg','me@kevon.me',null,'Oregon','HELL YA! Do it Oregon! Electric vehicles or bust. Fossil fuels should have died a long time ago. Charge Ahead!',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Debbie','Jimmerson','dajtypes@outlook.com',null,'Oregon','The rebate should apply to the base model price of the electric car.  Chevy Bolt, Tesla Model 3, and others would qualify for base price but can go over $50K if such options as longer range and quick charge ability are added to the car.  It would be difficult to justify some models of the same type of car being eligible and others not being eligible.  Determining from the base price would eliminate that confusion for car models that should be eligible for the program.  I can appreciate that the luxury models with higher base price than $50K may be excluded.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Joshua','Shulman','joshuashulman@gmail.com',null,'Oregon','Please make the rebates effective Jan 1. Anything else is not fair to those who depended on the law, which, after all, was passed many months ago now.  Please offer the maximum rebate amount.  The whole âscrap your old carâ and âlive in a poor air quality neighborhoodâ requirements should be scrapped. How does a person figure out if they live in âan area of the state with elevated concentrations of air contaminants commonly attributable to motor vehicle emissions?â And whyâs it matter? If I live on a bucolic, clean-aired farm, but commute into smogsville every day, the people of smogsville still benefit from my zero-emissions vehicle, regardless of where I reside.  And why does someone with a 20-year old car to scrap get $2500, but someone with a 19-year old car doesnât? Encouraging low- and moderate-income people to get EVs should not depend on where they live or how old their current car is.  âArea median incomeâ is confusing in several ways:   What yearâs median household income are we looking at? The year prior to purchase? The year of the last census?  What yearâs buyer income are we looking at? If one buys the car in 2018, does one determine whether one qualifies as âlow or moderate incomeâ based on income on 2017 tax forms? What if 2017 income is âmoderate,â but 2018 income is above that level?  Oregon must rely on a particular analysis to determine median household income. The regs should indicate where to find that analysis.  Is the median Household income based on number of occupants in the household? Are there different âmedian household incomesâ based on household size?   New topic - typo:  340-270-0120 (2)(f) - the word âAgreesâ should be âAgreeâ  340-270-0430 (1)(c) - do you want to say that the high-emission vehicle to be scrapped must have been registered to the person applying for the rebate for 2 years? Or just registered? Is there anything to stop one from buying an old car purely to scrap it for the rebate? Or is that consistent with the intent of the regs, as it still gets the vehicle off the road?','https://data.oregon.gov/views/b3xb-ujzi/files/308a2241-d5f0-4313-9855-003c88213fe6?filename=Shulman+Comment.pdf&content_type=application%2Fpdf');
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Marl','Miller','gwion@comcast.net',null,'Oregon','I firlmy believe that the public at every level administration must support the switch to renewable energy, and strongly support the Oregon rebate program. On a personal note, quite a few of us were assured that we needed to lease (in our case) a car before the first of 2018 in order to be eligible for the rebate, and we budgeted for that. So I would ask that people who switched to renewable anytime after the progam began in October 2017 be eligible. Thank you',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('alan','knowles','knowles.alan@gmail.com','resident','OR','Shoud honor the bill: provisions of HB 2017 establishing this program became effective on October 6, 2017 for us that purchased EV before end of year.  Why arbitrarily changing to 1/1/18. that is not what bill says and we took action based on this.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('greg','watson','greg.watson@gmail.com','none','OR','Thank you for offering the $2,500 rebate for EVs by law and for making all qualified vehicles purchased after Jan 1, 2018 be included.  I would also like to have this rebate extend into 2019 for at least $2,500 or more.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Joshua','Webster','joshowebster@gmail.com',null,'Oregon','For the Zero-Emission and Electric Vehicle rebate program I have several concerns. First, it appears that the program provisions listed just above Section 148 of HB2017 say that the provisions of the program are operative January 1, 2018, while Section 156 of HB2017 says that rebates may be issued for vehicles that were leased on or after the effective date of HB2017 (October 6, 2017). Rebates should be issued for those vehicles purchased or leased on or after October 6, 2017. Second, Section 148 (e) of HB2017 says the base manufacturer''s suggested retail price needs to be less than $50,000. The price determined to be base should be that of the lowest cost configuration of a particular model name, not including any extra features such as extended range, premium interior, additional cost color options, or software upgradable features, etc. Third, the rebate amount should be variable based on type of vehicle. Since the first year (2018) it is only available to limited types of vehicles that are most likey to be long range, multi passenger, and have the biggest impact on the environment, the full amount should be available. For future years when low speed vehicles and motorcycles that will generally be of higher overall efficency will be included, a tiered rebate amount for them to allow for more total rebates could be beneficial.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Ron','Drickey','rondrickey@gmail.com',null,'OR','As a tax payer, I fully support this new proposal.  Oregon should continue to be in the forefront of all 50 states in efforts to reduce the need for fossil fuels and its impact on the environment. Let Oregon be a leader!',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values (null,null,null,null,null,'Great idea! This benefits the environment as well as all Oregonians!',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Randy','Stone','RStone7266@AOL.com',null,'Oregon','What about a rebate for my 2017 Toyota Prius Prime bought in 2017.  Also where is my voucher verifying my purchase of a new, clean wood stove that I was supposed to submit with my 2016 income tax return.  ORDOE never came up with it.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Carey','Booth','carey.booth@reed.edu',null,'OR','I have enjoyed driving an EV since 2008 when I bought a ZAP Xebra with the help of an Oregon EV tax credit. EVs are the future of transportation. This rebate will help more people be able to afford to invest in the appropriate and clean technology.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Kent','Hughes','hugheskent@gmail.com',null,'OR','I would encourage that the proposed rule of a $50,000 cap on the suggested BASE MSRP remain the rule, excluding additional upgrade options like longer range batteries or software packages.  This would allow for the quicker adoption of EV''s by purchasers who are already stretching their budgets to purchase clean vehicles.  ',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Brian','Stewart','bstewart53112@gmail.com',null,'OR','Thank you for proposing rebates for zero emission vehicles.  It is important to encourage use of this new technology to hasten our reduction in burning fossil fuels.  I support the rebate plan.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Pasala','Ravichandran','psravic@gmail.com','Healthcare','OR','I support the rules',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values (null,null,null,null,'O','Mmm',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Patrick','Duhachek','pduhachek@gmail.com','Self',null,'I am against subsidizing the electric Car industry. ',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Jayson','Rambo','towels@yahoo.com',null,'Oregon','I thank you for the commitment to the environment you are showing with this proposal. I am greatly in favor and hope it passes. It''s needed even more now with current anti-environmental policies being put into play at the federal level.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Fran','Hewitt','franhome3@gmail.com',null,'OR','Thank you for (1) offering the full rebates allowed by law and (2) making all qualifying vehicles purchased after January 1, 2018 eligible for those rebates.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Patrick','Connor','Patrick@oeva.org','Oregon electric vehicle association','Oregon','As a life-long Oregonian, I appreciate our clean environment. Thanks for helping keep it that way and making it better.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Jennie','Mull-Scotty','jr_mull@yahoo.com',null,'OR','OAR 340 is a fantastic idea! Bravo and keep up the great work.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('MATTHIAS','BAUER','matthias_bauer88@yahoo.com',null,'Oregon',null,null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('MATTHIAS','BAUER','matthias_bauer88@yahoo.com',null,'Oregon','The rebate should be made effective August 18th, 2017 when Gov. Brown signed HB2017.  An effective date later than that is discriminatory to those individuals who purchased in that time window.  Thank you.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Cooper','Morrow','coopmorrow@yahoo.com',null,'Oregon','I am 100% in support of this rebate! Clean air now.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Eric','Miller','eric@millerwenger.net','Squishymedia','Oregon','I strongly support the proposed electric vehicle rebate program.  In particular I support the incentives associated with neighborhood vehicles and motorcycles, as smaller ''city'' vehicles have particular value for typical short trips in urban areas.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Morris','Green','morrisgreen@comcast.net',null,'OR','I support the draft rules and would like to compliment the DEQ for offering the full $2,500 rebate amount and offering the Charge Ahead program to encourage used EV sales for low and moderate income families.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Claude','Poliakoff','poliakof@ohsu.edu','OHSU','Oregon','If we don''t do everything possible to stop global warming, our progeny will suffer irreparable damage, if life is even sustainable',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('James','Marquard','james.marquard@gmail.com','Self','OR','When we''d purchased our Chevy Bolt, the incentives, both Federal and State,  were an important factor in that decision. Given that government has the role of providing incentives and disincentives to help move industry and individuals towards a more desirable outcome, we support  OAR340 EV Rebate 2018 rule making being considered. Climate change is real. Oregon''s steps to mitigate the worse of what is coming, should be supported. The International Monetary Fund estimates the world provides $5.3 TRILLION annually to subsidize fossil fuels. Their estimate for renewable energy subsidies to be $120 Billion. That''s 0.02 percent. This needs to change. It is backwards. Support OAR340 EV Rebate, please.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Thalia ','Ohara','honuhuli@yahoo.com',null,'Oregon','I believe that  electric cars are the way to go.  And for the State of Oregon to offer a rebate encourages people to make more conscientious decisions about  gas vs. zero emission.  I hope Oregon decides to  do the rebate program.  It offers an incentive for people who wouldn''t consider it without one.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Richard','Espenscheid','gypsum@ureach.com',null,'OR','Thankyou for working to promote electric vehicles and protect our enviroment',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('David','Regan','dregan02@msn.com',null,'OR','I support offering the full rebate allowed by law as soon as possible.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Frank J','Perruccio','F2JP@aol.com',null,'OR','I am very happy to see Oregon embracing the opportunity to incentivize the adoption of zero emission vehicles.   I sincerely hope that the incentives are significant enough to have meaningful impact.   We drastically need to accelerate the move away from fossil fuels.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Neal','Keefer','nvkeefer@msn.com',null,'OR','I support rulemaking that grants purchasers of electric vehicles on or after January 1, 2018 a rebate of up to $7,500. I understand that this rebate is funded by a fee assessed to new car purchasers. I believe that this type of incentive will have a positive impact on zero emission vehicle purchases and as such will be contributory to helping reduce the State''s greenhouse gas emissions.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Shawn','Looney','looneysters@gmail.com','-YYYY-','Oregon','I purchased a plug-in hybrid on August 29, 2017.  Part of my incentive to buy was my understanding of a State rebate.  The rebate program is/can be great environmentally.  Please stick with the 2017 Rules and go forth with the Program. ',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Cynthia','Care','cynthia.care123@gmail.com','citizen','OR','We need the EV rebate in Oregon!',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Brian','Cochran','briancochran@mac.com',null,'OR','Thank you for offering this rebate.  "Base MSRP" rule needs to be defined into specifics. It is important for this rebate to cover the Tesla Model 3, regardless of options, battery size, and software packages.  The base model for the Tesla Model 3 is $35,000, but current packages can exceed $50k.  This model is being mass-produced and a significant amount of Oregonians, needing this credit, will be purchasing this model. This model may be above our normal range of affordability now, but this vehicle is important in terms of showing how zero-emission EVs are superior to internal combustion engine cars in terms of safety, efficiency, technology, performance, maintenance, and aesthetics. These rebates are critical for the initial transition to a new technology. ',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Bill','Farmer','Farmers111@gmail.com','Farmers Table Grapes','Oregon','As a first generation voting 70 year old Oregonian, I would like to see the rebate available to everyone.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('David','Edrington','edarchitect@qwestoffice.net','David Edrington, Architect','OR','Please see my attached comments ','https://data.oregon.gov/views/b3xb-ujzi/files/4a5a732a-3613-4346-b33e-dc70151e3dc3?filename=Note+to+DEQ.pdf&content_type=application%2Fpdf');
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Andrew','Harbison','harbisona@hotmail.com','Citizen','OR','I purchased a Chevrolet Bolt EV in January 2017 primarily to take advantage of the federal tax rebate (of up to $7,500). While I am also interested in a non-emissions means of transportation, this federal tax rebate made the proposition more immediately-palatable and motivated me to act, quickly, as it is to eventually be phased-out.     As the air quality in the greater Portland, Oregon area continues to be challenged by fossil fuel-based transportation (particularly, diesel emissions), there is importance in the state encouraging its citizens to contribute to the effort to improve their environment and, thereby, the health of their fellow citizens -particularly given the fact that many of these citizens are relatively-forced to reside in housing that is routinely and exceptional close to the source of such emissions (i.e. Low-income housing located near major thoroughfares such as interstate highways).     Additionally, affordability is broadening across the socioeconomic-spectrum for currently-available, high-quality electric vehicles with exceptional range; as the “electric highway” continues to take shape, more of the region will continue to become accessible to them.     Through an incentive-program that can truly be accessed by all of its citizens, Oregon’s DEQ is demonstrating the fundamental-commitment of leadership necessary to transform the common form of energy used for transportation into one that is more-consistent with the public good.     Andrew Harbison,  NE Portland',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Ken','Nichols','ken@eqlenergy.com','EQL Energy','OR','DEQ staff and counsel should update public on AAA court case and its impact on the EV rebate program. I''m concerned there is too much uncertainty for dealers and public to participate in a program that may not be funded.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Tim','Wollerman','wollerman.tim@deq.state.or.us','DEQ','Oregon','test',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Edward','Louie','louieed@oregonstate.edu',null,'OR','I think it would be wise to consider the alternative of giving out rebates to those who are low and middle income first as opposed to a first come first serve basis. As other public commenters have said, those who have already purchased a car and applied for the rebate via the Phase 1 application are likely people who would have purchased an EV even if the rebate program were non-existent. Please see attached for 9 additional comments. ','https://data.oregon.gov/views/b3xb-ujzi/files/070977ef-9d12-47ab-9c25-db1f13f95c08?filename=Comments+to+the+Electric+Vehicle+Rebate+Program.docx&content_type=application%2Fvnd.openxmlformats-officedocument.wordprocessingml.document');
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Debra','Hollenback',null,null,'OR','Consumer incentives are key for the early adoption of electric cars.  According to the Union of Concerned Scientists, a Tesla Model 3 driven in Corvallis (my home town) is the CO2 equivalent of driving a gas car that gets 93 MPG.  I support an EV rebate program. ',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Mark','Lander','landerm@comcast.net','None','Oregon','I would like the committee to consider the effective date to be after August 2017, when Governor Brown signed the bill.  I am wondering how many people purchased electric vehicles after that date thinking it would be in effect in 2017.  I was one of those people.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Nathan','Howell','N8Howell33@hotm',null,'Oregon','I think it is wise to offset some of the extra cost that is built into an EV. It helps potential buyers consider EV''s instead of going with traditional ICE cars. As we know ICE cars are bad for the environment and require fossil fuels. EV''s require less maintenance and can be charged at home at night. Oregon is a leader in many things, and I would love to see it continue to be a leader in the EV realm by offering this tax credit for EV purchases. Please do what is right for the state and environment and fund this bill. ',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Steven','Douglas','sdouglas@autoalliance.org','Alliance of Automobile Manufacturers and Global Automakers','CA','The Alliance of Automobile Manufacturers and Global Automakers respectfully submit the attached comments on the EV Rebate 2018 Rulemaking','https://data.oregon.gov/views/b3xb-ujzi/files/969474f2-6a8e-437c-a1ce-204df88b764e?filename=OR+EV+Incentives+Joint+Comments.pdf&content_type=application%2Fpdf');
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('David','Kruse','dbkruse@comcast.net','Mr.','OR','Any rebates should be gradually reduced to encourage more innovation.Not paying gas taxes should be enough of an incentive. ',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Jennifer','Cambier','jschnied@gmail.com',null,'OR','I specifically delayed the purchase of my EV until after October 6, 2017 when the bill was to become effective. I ask the committee to consider making these late 2017 purchases retroactive and eligible for the rebate. It was not possible for our family to wait until after January 1, 2018 when we might have had a better change of getting the rebate.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Thomas','Payne','tpayne@uoregon.edu',null,'OR','I am in favor of rebates for zero-emissions vehicles.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Tauran','Ivall','t.ivall.or@gmail.com','Resident','OR','Oregon should extend the rebate amount to $7000 to match that of California. see link https://cleanvehiclerebate.org/eng/eligible-vehicles',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Robert','Levy','rob@roblevy.com',null,'OR','I think its important for our state to "catch up" to other states such as Michagan and California with this rebate. I know I for one will use it.  January 1st 2018 as a start date seems fair.  I see a major push by GM today to add onto the federal rebate, or scrap the 200k car limit on it at least.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Doris','Payne','doris_payne@sil.org',null,'OR','The EV rebate program is important to the country, and to our children and their children. Rebates should be available to people regardless of whether they live in a poor-air quality area or not, as the rebate program supports the entire industry, making zero-emission vehicles more accessible generally. ',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Erin','Quinn','equinnox@yahoo.com','UO','OR','I drive a gas-guzzling 1995 Ford Explorer, and I''ve been waiting to lease a zero emissions vehicle to replace my old SUV, but cannot yet afford to do so.  I am hopeful that OR will lead the way in making zero emissions rebates and incentives a reality for all citizens regardless of income levels.  People who earn more than a certain amount in income should have to pay more taxes, and corporations that pollute should have to pay the most taxes of all to support this!  ',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('George','Feldman','feldmange@gmail.com','physicians for social responsibility','Oregon','I am strongly in support of ANYTHING you can do to encourage increased numbers of non-carbon burning cars.   The local power plants still get 20% approximately of their electricity from coal, but it is a start.  When solar banks can give us electricity, we will have the ultimate winner!',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Brenda','Pace','jetpace@bendcable.com',null,'OR','$2,500 seems too low to encourage lower income households to participate.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Dave','Ganslein','daveganslein@hotmail.com','Outcasts Car Club','Oregon','I oppose any program to scrap older vehicles. Not all older vehicles are fuel-inefficient. Cash for clunkers was a disaster and deprived many Americans of affordable transportation',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Hope','Robertson','hrobertson9@wildblue.net','Robertson''s Current Analysis','Oregon','Thank you for implementing incentives to encourage the purchase or lease of zero-emission vehicles.  My primary comment is that the $2,500 incentive for low income residents sets way too high a bar to be useful.  The number of people that own a car over 20 years old and live in an area with serious air pollution and meet the income requirements is probably so small to be meaningless.  Let''s keep it simple.  Just use the income as the determinant of whether someone qualifies for getting the $2,500 rebate.  The purpose of this is to expedite the uptake of zero-emission vehicles.  So let''s do it and not make it so hard especially for people who might not be able to buy one otherwise.  Thank you for pushing ahead with this incentive.  I happen to own an electric car which we purchased in 2017 - a Chevy Bolt. I would love to see thousands of similar cars travelling around Oregon.  The next step is to make sure the charging infrastructure is in place.  Thank you.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('James','Neu','Jjneusies2@gmail.com','350.Eug','Oregon','I believe the vehicle incentive should be retroactive back to 10/17 and continue for as long as possible. Now is the time to get off fossil fuels and switch to EV''s and 100% renewable energy sources. Oregon is fortunate to have mostly renewable sources of energy and we need to commit to clean energy. I took advantage of the last incentive program two years ago and got photovoltaic on my roof and an electric vehicle drastically reducing my carbon footprint. I know more people who would do the same if these incentives were offered today. Tax the fossil fuel industry heavily and use those funds to get people in EV''s and on electrical generation and off of fracked gas. ',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Dave','Potter','kpottermom@yahoo.com','none','OR','My wife and I 100% support State govt. doing all it can to foster/increase electric vehicles or other zero emission cars or trucks.  We support OAR 340, division number 270.  We may have missed it but saw nothing about fostering more charging stations all across Oregon.  Also fostering solar panels on vehicle roofs and on parking lots to power charging stations/plug ins.   Oregon should make rules and pass laws for all of these features to better clean our air of exhaust pollution.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('virginia','Feldman','feldmanvi@gmail.com','none','OR','I urge you to assure that there''s an ongoing Electric Vehicle Rebate program. I bought an electric car last year mainly because of the rebates, which made it more affordable. It was a huge incentive. If we want a zero-emissions state or country, we have to give environmental incentives as much as we give to oil & coal.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Mark','Adams','hawkeye861@yahoo.com','Self-General Consumer','Oregon','Regardless of the industry, incentives are one of many keys that continue to drive good behaviors for our local economy.  Consumers and small businesses who invest in EV''s and solar collection systems, via the purchase of goods and services from an Oregon based business, favorably impact our economy each and every day.  We see the positive results in our employment reports and ongoing business expansion in numerous Oregon communities.  Like others commenting on the effective date, I support a retroactive rebate back to the date Gov. Brown signed off - August 2017.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Verna','Triller','vtriller@live.com',null,'OR','Anything that helps cut emissions should be pursued by the State of Oregon. We should be the leader in all things pertaining to the environment.  People  move here for the natural beauty of our State and our forward looking environmental policies, so this is a MUST!?',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Rustam','Kocher','indo.kochers@gmail.com',null,'OR','The EV rebate was the right thing to do, it was the right way to tackle air quality concerns, and it should be completed by being put into affect. We all breathe the same air, and we all live on the same earth. Climate change is real, and we must take steps to address it, or it will have devastating effects on humans and all organisms. We need to stop putting CO2 into the atmosphere-and the EV debate is a great way to encourage that changed behavior. ',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Richard','Durst','durstenergy@gmail.com','Individual','Oregon','Page 18 of the proposed rules states that there are no Federal Rules concerning rebates for Zero emission vehicles, where in fact there are rules. Shouldn''t these rules be addressed and some discussion as to why the proposed Oregon rules are different as pertaining to the eligible vehicles?. https://www.irs.gov/businesses/qualified-vehicles-acquired-after-12-31-2009   Here is a link to the Federal rules.  Shouldn''t Oregon use a phaseout approach for certain vehicles similar to the Federal rules? Why is Oregon selecting a 10 kWh battery size vs the Federal 5 kWh battery size?   Is the rule also adds a minimum of 10 miles electric range (which is good,) for eligible vehicles, but should discuss why it is different from the Federal rules I think using the more restrictive rules may match other states which is good, but should be noted as to why different than the Federal. Following the more restrictive requirements, since we are a ZEV state is great.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Ron','Miller','advnw@aol.com','self','Oregon','Trying to promote zero emission vehicles is noble, but there are costs associated with electric cars that are problematic.  Mining for battery production creates pollution in itself (lithium).  Cobalt, another key ingredient, is in short supply and will be unable to meet projected demand.////  Many of the vehicles targeted by this rebate policy are for the upper middle class - Tesla and BMW taking the lead.  This demographic hardly needs help.  No mention is made of the fact that our infrastructure loses funding as EV,s become commonplace.  No point to give a break one place and tax another. ',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Debra','McGee','zap_oregon@msn.com','350Eugene','Oregon','Please move this forward so citizens will be incentivized to transition to the clean energy we need in our future. We must get off of fossil fuels as they are changing the basic dynamics of our only habitat.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Nancy','Padberg','zigzagmolly@yahoo.com',null,'Oregon','Please help make choosing an electric vehicle more affordable.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Mark','Sommers',null,null,'OR','Based on the information that was available when the program was introduced last year "The provisions of HB 2017 establishing this program became effective on October 6, 2017.", a lot of people believed as we did, that the qualification period would start at the effective  date, i.e. 10-6-2017. Pushing it back now to 1-1-2018 is not fair to the people that purchased their vehicles end of last year. Therefore, please consider what was stated in the initial announcement and honor the qualification date of last year October.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Patricia','Hine','zap_oregon@msn.com','350Eugene','OR','The creation of a zero-emission vehicle rebate program is a very important strategy for reducing emissions from our transportation sector.  If we in Oregon are to meet our commitment to respond to the dangers of our warming world, this is certainly an important step we can and should take now.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Rohit','Jain','rohit1812@yahoo.com','Self','OR','For charge ahead rebate : the should not be any income ruling it should be any card which are 20year old n above should be given this rebate . Because if you set limit on income , it will be very difficult for low/moderate income person to provide any details and extra paperwork . Also there is no mention on the income limit to qualify for this program anywhere ?',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Sridhar','Balakrishnan','sbalakr@htmail.com',null,'OR','I support offering rebtes to people in Oregon who purchased EV/PHEVs in 2018. They are helping keep Oregon green.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('David','Looney','looneys@involved.com','Mr.','OR','We purchased our plug-in Prius on Aug. 29, 2017 assuming we could get an Oregon rebate.  Please adhere to 2017 Adopted Rules.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Louise','Shawkat','louise40208@hotmail.com',null,'oregon','A rebate jis a way to increase the number of ZEV''s on the road.  Oregon is not going to meet its projected goals as we keep doing business as usual.  We really need a massive program to remove old cars from the road.  CAFE standards are only good for new cars.  We also need to ban diesel cars and buses from the roads. Rebates help people to get on board I think it is great to identify folks from low income household to get a benefit.  Really, a 20 yr old car? That is 1998-Why not start with a later yr..like 2000?',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Marlene','Winn','winndm@q.com',null,'Oregon','Please provide rebates to electric car purchasers.  This will greatly enable more residents to purchase these vehicles that will pollute far less.  Thank you very much.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Ari',null,null,null,null,'This program will be incredibly successful and great for Oregon. I agree with others who have commented that the vehicle base MSRP (without options) should be limited to $50,000 not the purchase price because the way the rule is currently written it could slow the adoption of the first round of compelling mass market electric vehicles by limiting options to vehicles with shorter range and slower charging capabilities. In order to promote the quickest transition of the vehicle fleet to zero emissions vehicles and economies of scale that can reduce the price of ZEVs and negate the need for ZEV incentives early adopter consumers will need to purchase cars that hover in the $50,000s. This is more than most consumers are traditionally accustomed to paying up front and the $2,500 rebate can still be very helpful to this group of consumers',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Jill','Reese','jillnicolereese@gmail.com','International Union, United Automobile, Aerospace and Agricultural Implement Workers of America (UAW),','Oregon','Attached','https://data.oregon.gov/views/b3xb-ujzi/files/8e03f178-e30b-4c50-9a6e-d08f074993dd?filename=UAW+Region+5+OR+EV+Rebates+comments.pdf&content_type=application%2Fpdf');
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('David','Carnese','primocarnese@hotmail.com',null,'Oregon','Please adopt the Zero Emission and Electric Vehicle Rebate program',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Traig','Van Dyke','ergoaudrey@hotmail.com',null,'OR','Since the goal of this program is to encourage people to transition to zero emission vehicles, ANY fully electric or hydrogen fuel cell vehicle should be candidates for a rebate, regardless of base price.  A maximum base price would only prevent some of the longer range battery electric vehicles from qualifying, such as the Tesla Model X, Model S, and Jaguar I-Pace.   Plug-in hybrids, however should not qualify for a rebate since most have very small battery packs (less than 10kWh), which often provide electric-only ranges well below the average commute.  And even in electric-only mode with most plug-in hybrids, pressing the gas pedal down far enough will engage the internal combustion engine to assist.  These cars continue to harm our health, the environment, and maintain our reliance on oil.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('James','Hannan','jhannan29@yahoo.com','None','Oregon','The retroactive rebate element of the plan is broken.  All Oregonians benefit from each electric motor powered vehicle mile that replaces an internal combustion engine powered vehicle mile.  Electric powered vehicles that were purchased longest ago have benefited us all the most, and those most recently purchased have benefited us all the least.  The retroactive rebate as envisioned now acts in exactly the opposite way, it rewards those who purchased electric vehicles recently and ignores those who foresaw the issue long ago and took action.  This needs to be fixed.  It may be easier to use an arbitrary rebate eligibility span beginning in January of ''18 or even October of ''17, but this is the wrong thing to do.  Just because it is easy does not bake it right.  Rebates need to be offered to those who purchased electric vehicles first.  Electric power only vehicles should see a greater rebate than plug-in hybrid vehicles.  The relative amounts would be arbitrary, probably based on average electric power to gasoline power ratio from typical hybrid vehicle usage, but the rebate system should incentivise 100% electric vehicle purchases to a greater amount than plug-in hybrid vehicle purchases.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('byron','carrier','carrierbrad@gmail.com',null,'OR','See attached comments','https://data.oregon.gov/views/b3xb-ujzi/files/a0fd86c5-593c-434e-92c4-7272ed2a0be7?filename=DEQ+Rebate+Rule+comment+request.docx&content_type=application%2Fvnd.openxmlformats-officedocument.wordprocessingml.document');
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Graham ','Trainor','graham@oraflcio.org','Oregon AFL-CIO','OR',null,'https://data.oregon.gov/views/b3xb-ujzi/files/13f563b9-82a5-4f1c-8aec-648c327d6f38?filename=3.13.18+OR+AFL-CIO+Comments+On+Electric+Vehicle+Rebates%2C+Proposed+Rulemaking.pdf&content_type=application%2Fpdf');
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Robert','Ralston','bob@ubcobikesus.com','Ubco Bikes US, LLC','OR','I compliment DEQ for introducing a rebate program focused on incentivizing consumers to purchase or lease zero-emission vehicles.  The comparative cost of power train systems between fossil fueled and electric powered vehicles is narrowing as EV technology and product manufacturing continues to evolve.  That said, if the vehicle choice of today’s consumer is based on purchase price then rebate programs such as this will go a long way in helping bridge the consumer’s adoption and demand for zero-emission vehicles.   As the US distributor of a 30 mph pure electric motorcycle, I would like to make a strong suggestion that DEQ reconsider their proposed rule that an electric motorcycle must be capable of attaining a speed of 55 mph or greater to qualify for this rebate program.   A speed of 55 mph or greater would suggest that the primary focus of this rebate program is intended for vehicles capable of highway transportation.  The current DEQ proposal is a good plan, but it could be better in helping to drive the use of affordable zero-emissions vehicles used for daily transportation across all economic categories particularly with low to middle income households who could really benefit in replacing 20 year old internal combustion vehicles with clean, affordable zero-emissions urban transportation vehicles.  What if you reconsidered the vast use of vehicles used for inner city, urban transportation and commuting needs that will never see a mile of 55 mph + highway use.  The concentration of internal combustion cars and vehicles in our cities contribute to poor air quality and overall congestion.  I’m suggesting the inclusion of two-wheel zero-emission motor vehicles or electric motorcycles that fall into a motor vehicle class or category that ranges in maximum performance speeds of 30 to 50 mph. This performance speed class of electric vehicles is growing and will continue to evolve in our cities and urban environment as an affordable choice for daily transportation.  My recommendation to DEQ is that you consider modifying your proposed rebate program to include 30 to 50 mph, two wheel, zero-emissions motor vehicles as well.  Thank you.  ',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Leslie','Lowe','inharmony46@charter.net',null,'OR','I just bought a hybrid plug in (2017 Ford C-Max energi).  Ford has quit making these cars because so few were purchased.  A solid rebate program would encourage more people to buy electric vehicles.  I put on solar panels to use instead of coal burning plants to produce my electricity.  We need to m aintain rebates for solar panels and do  more advertising to encourage folks to do both solar panels and plug in cars.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Fabiola','Lao','fabiola.lao@energycenter.org','Center for Sustainable Energy','Multiple states','Please see attached file','https://data.oregon.gov/views/b3xb-ujzi/files/293c6b6b-8270-4975-adf0-a038cefe6403?filename=OregonEVRebate_ProposedRulesComments_FINAL.pdf&content_type=application%2Fpdf');
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Terrance','Hawley','565 Shelokum Dr','Silverton','OR','Consider matching the Federal incentive for $7,500 that is expected to expire this summer ill expire for America''s largest EV manufacture. Oregon''s timing of ZEV tax credits is excellently positioned to help ensure the continued acceptance of EVs and a better future for our grandchildren. ',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Charles','Smith','Smith2650@comcast.net ',null,'Oregon ','I fully and enthusiatically support the rebate program.  I think the effective date should be moved back to the effective date of the legislation, which I believe was sometime in October of 2017.  I leased a  electric vehicle in November with an understanding that the bill had passed and that the rebate would or should apply to such leases given the legislature''s apparent intent.  I  believe that the charge ahead program has great potential and that helping lower and moderate income people purchase EVs, especially used EVS will be most beneficial.  I hope that the agency will developed some simple forms to help people meet the requirement of showing how they meet the income, residential location, and scrap requirements.  I wish the legislature had either not included the scrap requirement or made it so that it was a bonus rebate so that an otherwise qualified person would receive at least half of the intended rebate even if they did not scrap a car of at least 20 years old.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Travis','Gintz','tgintz@gmail.com',null,'OR','I support this. We need to get away from Fossil Fuels. The NW uses renewable energy and can benefit greatly.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Judith','Huck','judith.huck@comcast.net',null,'Oregon','We support zero-emission vehicle rebates which encourage vehicle buyers to consider, and hopefully purchase, zero-emission vehicles.  This in turn helps all of Oregons citizens by reducing the amount of pollution in our air.  We also encourage DEQ not to have a maximum on the EV car purchase price to qualify for rebate.  Why discourage a buyer from buying a car with longer range?  More expensive cars usually have longer range.  Putting a maximum purchase price may discourage those living in rural areas from considering EV''s.  Thank you',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Quinn','Sullivan','qsullivan11@gmail.com',null,'OR','This would be a great program. In the use of fossil fuels, there are unpaid externalities in the form of air pollution locally, and greenhouse gases globally. This program would help encourage the use of electric vehicles, and encourage the implementation of more renewable energy sources.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Pete','Jorgensen','gp.pete.jorg@gmail.com','OEVA','OR','Oregon has long been one of the leadres in helping driverz shift their dependence from fossil fuel vehicles.  Until the auto industry makes a greater comitment to electric & hybrid vehicles, we need to continue to provide car buyers with incentives so that we leave our children & grandchildren with a liveable environment.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Aundreen','Mitchell','Aundreen@gmail.com',null,'Oregon','We need to pass a law that favors electric cars. We need to keep Oregon green!',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Jill','Messecar','jillmessecar98@gmail.com','Citizen','OR','Here is the link for the EV I support the EV rebate program and wish it to be implemented as soon as possible to encourage and accelerate mass adoption of clean and cleaner fueled vehicles.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Jill','Messecar','jillmessecar98@gmail.com','Citizen','OR',' I support the EV rebate program and wish it to be implemented as soon as possible to encourage and accelerate mass adoption of clean and cleaner fueled vehicles.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('David','Reeck','david.131313@gmail.com','Douglas County Smart Energy','Oregon','PHEVs like the Chevrolet Volt do NOT FULLY deplete the battery before partially recharging by means of the ICE and generator.  Recharging will occur at about 10-20% battery state-of-charge.','https://data.oregon.gov/views/b3xb-ujzi/files/982c7744-b64a-4bba-9ce7-63faffe1bd95?filename=DEC+rules+for+USD+2500+rebate+in+Oregon+Mar2018.pdf&content_type=application%2Fpdf');
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Scott','Phelan','mtnchieftain@yahoo.com',null,'Oregon','The best way to promote the use of electric vehicles is through a vehicle rebate program.  These cars are very expensive and the best EVs will easily cost more than the proposed $50K MSRP cap.  People should be allowed to purchase the most efficient EV in terms of range and required options.  Oregon is a vast state and many require the added range that is required to travel the state.  The initial group of EVs currently for sale easily exceed the $50K limit. Limiting the $50K to base price would be a better option.  This will incentivize the greatest number of people who aren''t interested in the least capable EV currently offered, but will adopt the EV that meets their needs that currently cannot be purchased for an MSRP of under $50K.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Reed','Arce','RCArce01@yahoo.com',null,'OR','As an Oregon taxpayer I fully support this rebate and believe it should be implemented to help spur a faster transition to cleaner energy consumption. I will continue to support Oregon towards becoming a leader in renewable energy (both generation and consumption) in order to keep our state clean and green.',null);
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Kayse ','Jama','darlene@uniteoregon.org','Unite Oregon','Oregon','please see attached document for public comment','https://data.oregon.gov/views/b3xb-ujzi/files/96f67424-706d-42f3-bd08-6c735aa4280e?filename=OR+rebate+public+comments+sign-on_3.6.2018.docx&content_type=application%2Fvnd.openxmlformats-officedocument.wordprocessingml.document');
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Dan','Meek','dan@meek.net','Independent Party of Oregon, Oregon Progressive Party','Oregon','Proposed Rules are Misguided, Disregard Small Electric Vehicles.  See attached testimony, with photos.','https://data.oregon.gov/views/b3xb-ujzi/files/9b5e5842-723f-4713-91d8-0639027e1760?filename=elecvehicle_comments_wpics.pdf&content_type=application%2Fpdf');
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Jana','Gastellum','janag@oeconline.org','Oregon Environmental Council','Oregon',null,'https://data.oregon.gov/views/b3xb-ujzi/files/4a87c411-04c4-4619-82d1-b96132cd59b0?filename=OEC+EV+Rebate+Written+Comments.pdf&content_type=application%2Fpdf');
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Ranfis','Villatoro','rvillatoro@bluegreenalliance.org',null,'Oregon','Fair and Responsible','https://data.oregon.gov/views/b3xb-ujzi/files/2f9ae6cb-49ea-4adb-98e0-4e079a99ff80?filename=Fair+and+Responsible+EV+Rebate.docx&content_type=application%2Fvnd.openxmlformats-officedocument.wordprocessingml.document');
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Jeff','Allen','jeffa@forthmobility.org','Forth','OR','Attached','https://data.oregon.gov/views/b3xb-ujzi/files/53b9ae05-5d95-4b95-9c4c-72893d8d7401?filename=DEQ+Forth+EV+Rebate+Rulemaking+Comments.pdf&content_type=application%2Fpdf');
Insert into CY.EV_REBATE_COMMENTS (FIRSTNAME,LASTNAME,EMAILADDRESS,ORGANIZATION,STATE,COMMENTDESCRIPTION,ADDITIONALDOCUMENT) values ('Regna','Merritt','regna@oregonpsr.org','Oregon PSR','OR','Thank you for this opportunity to comment on the Proposed Rulemaking for Zero Emission and Electric Vehicle Rebate Program  These rules are too limited in scope because they designed to subsidize only large electric vehicles. We request that they be modified and that definitions of qualifying vehicles include small electric vehicles (SEVs).   There are many dozens of makes and models of SEVs on the market, including scooters. bicycles, tricycles, and velomobiles. Their sales are limited due to costs related, in part,  to the electric motor.  Providing a sizable rebate for SEVs would likely change that. This could benefit low-income residents, for whom purchase of large electric vehicles, even used vehicles, is prohibitively expensive.  There are obvious public health benefits to use of SEVs but encouraging use of these vehicles would produce additional economic benefit for SEV manufacturers in Oregon.  Examples of proposed definitions that exclude most SEVs:  1. The definition of "light-duty zero emission vehicle" includes only vehicles capable of traveling at 55 MPH.   2 The definition requires that the vehicle have four wheels.  3.The requirement that the vehicle be able to travel 75 miles on a charge.   4.The definition of "neighborhood electric vehicle" as one can at travel at 25 mph. This excludes electric-assist bicycles and tricycles and velomobiles, as Oregon law requires that they have a top speed of 24 mph.  5.The definition of "zero-emission motorcycle"  requires that the vehicle go 55 mph, a speed not desirable or even legal for most urban trips.   Additionally, the rules should be improved to support hybrid human-electric powered tricycles, which reduce diesel pollution from trucks and  increase energy efficiency in transporting freight. One need only look to Europe for examples of cities have banned combustion-engine trucks from their central areas. Electric vehicles, including fleets of hybrid human-electric powered tricycles, are used there to deliver goods.  SEV''s reduce air and noise pollution, reduce traffic congestion and improve public health. Please include SEV''s in the rebate program.  Thank you for your consideration,  Regna Merritt',null);
